import React from 'react'

function Menu({menuItem}) {
    return (
        <div className="item">
            {
                menuItem.map((negocio) =>{
                    return <div className="item-con" key={negocio.id}>
                        <div className="item-container">
                            <img src={negocio.image} alt=""/>
                            <h2>{negocio.title}</h2>
                            <p>{negocio.description}</p>
                        </div>
                    </div>
                })
            }
        </div>
    )
}

export default Menu;
